export function dada() {
  const now = new Date();
  const day = now.getDate().toString();
  const month = (now.getMonth() + 1).toString();
  const year = now.getFullYear().toString();
  let hour = now.getHours().toString();
  hour = ('0' + hour).slice(-2);
  let minute = now.getMinutes().toString();
  minute = ('0' + minute).slice(-2);
  const date = day + '.' + month + '.' + year.substr(2) + ' ' + hour + ':' + minute;
  return date;
}

export function tableToJSON(name) {
  const table: HTMLTableElement = <HTMLTableElement>document.getElementById(name);
  const cols = table.querySelectorAll('thead tr th');
  const totalrows = table.querySelectorAll('tbody tr');

  const columns = [];
  const rows = [];

  cols.forEach(col => {
    columns.push(col.textContent);
  });

  totalrows.forEach(row => {
    const arr = [];
    (<any>row.childNodes).forEach(cell => {
      arr.push(cell.textContent);
    });
    rows.push(arr);
  });
  return {columns, rows};

}

export function tableToJSPDFData(name: string) {
  const table: HTMLTableElement = <HTMLTableElement>document.querySelector(name);

  let group = [];
  let data = []; // first row needs to be headers
  let headers = [];
  let footers = [];
  // tslint:disable-next-line:prefer-for-of
  for (let i = 0; i < table.rows[0].cells.length; i++) {
    let htext = table.rows[0].cells[i].innerHTML;
    htext = htext.replace(/\/\/n/g, '\n');
    headers.push(htext);
  }
  // // go through cells
  for (let i = 1; i < table.rows.length; i++) {
    let tableRow = table.rows[i]; let rowData = [];
    // tslint:disable-next-line:prefer-for-of
    for (let j = 0; j < tableRow.cells.length; j++) {
      if (tableRow.parentElement.tagName !== 'TFOOT') {
        let text = tableRow.cells[j].innerHTML;
        text = text.replace(/\/\/n/g, '\n');
        rowData.push(text);
      }
    }
    data.push(rowData);
  }

  if (table.rows[table.rows.length - 1].parentElement.tagName === 'TFOOT') {
    for (let i = 0; i < table.rows[table.rows.length - 1].cells.length; i++) {
      footers.push(table.rows[table.rows.length - 1].cells[i].innerHTML);
    }
  }

  return { head: [ headers ], body: data, foot: [ footers ] };
}

export function breakLine(string) {
    if (string !== null) {
        const formattedString = string.split(', ').join('\n');
        return formattedString;
    } else {
        return string;
    }
}

export function breakLine2(string: string, value, value2) {
  if (value == null) {
    value = '';
  }
  if (string !== null) {
    if (string.length > 30) {
      if (string.indexOf(', ') !== -1) {
        const formattedString = string.split(', ');
        if (!isNaN(parseInt(formattedString[0], 10)) === true) {
          let stringpart = formattedString[0] + ', ' + formattedString[1];
          for (let i = 2; i < formattedString.length; i++) {
            stringpart = stringpart + '\n' + formattedString[i];
          }
          if (value2 == null) {
            stringpart = stringpart + '\n' + value;
          } else {
            stringpart = stringpart + '\n' + value + '\n' + value2;
          }
          return stringpart;
        } else {
          let stringpart = string.split(', ').join('\n');
          if (value2 == null) {
            stringpart = stringpart + '\n' + value;
          } else {
            stringpart = stringpart + '\n' + value + '\n' + value2;
          }
          return stringpart;
        }
      } else {
        const formattedString = string.split(',');
        if (!isNaN(parseInt(formattedString[0], 10)) === true) {
          let stringpart = formattedString[0] + ', ' + formattedString[1];
          for (let i = 2; i < formattedString.length; i++) {
            stringpart = stringpart + '\n' + formattedString[i];
          }
          if (value2 == null) {
            stringpart = stringpart + '\n' + value;
          } else {
            stringpart = stringpart + '\n' + value + '\n' + value2;
          }
          return stringpart;
        } else {
          let stringpart = string.split(',').join('\n');
          if (value2 == null) {
            stringpart = stringpart + '\n' + value;
          } else {
            stringpart = stringpart + '\n' + value + '\n' + value2;
          }
          return stringpart;
        }
      }
    } else {
      if (value !== '') {
        string = string + '\n' + value;
      }

      if (value2 !== null) {
        string = string + '\n' + value2;
      }
      return string;
    }
  }
}

